import './App.css';
import Header from './components/header';
import DoctorList from './components/doctorList';
import practoData from './components/practoData';

function App() {
    return (
        <div>
            <Header />
            <DoctorList />
            <DoctorList />
            <practoData />
        </div>
    );
}

export default App;
